import React from 'react';
import { View, Image, StyleSheet } from 'react-native';
const HomeIcons = () => {
    return (
        <View style={styles.h_icons}>
            <View style={styles.h_flex}>
                <View style={styles.h_Imgs}>
                    <Image source={require("../../assets/h_1.jpg")} style={styles.h_img} />
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    h_icons: {
        width: '100vw',
        backgroundColor: "#fff",
        boxShadow: ' rgba(0, 0, 0, 0.05) 0px 6px 24px 0px, rgba(0, 0, 0, 0.08) 0px 0px 0px 1px',
    },
    h_flex: {
        width: '95vw',
        padding: '10px',
        margin: 'auto',
        backgroundColor: "#ff",
        flex: 1,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    h_Imgs: {
        width: '60px',
        height: '60px',
        borderRadius: '50%',
        backgroundColor: "#FDEFD9",
        alignContent: 'center',
        justifyContent: 'center',
    },
    h_img: {
        width: '30px',
        height: '30px',
        color: "orange",
        borderRadius: '50%',
        left: '15px',
        position: 'absolute'
    },
    h__img:{
        width:'28px',
        height:'28px',
        color:"#000",
        fontWeight:'600',
    }

})

export default HomeIcons;
